const HomePage = ({ displayPosts }) => {
  return (
    <>
      <Header />

      <PostWrapper>
        <div>{displayPosts()}</div>
      </PostWrapper>
      {/* <div className='side-bar'>
          <Sidebar />
        </div> */}
    </>
  )
}

